import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class BasicInfoRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="basicInfoResults">
				<div className="name">{this.props.name}</div>
				<div className="address">{this.props.address}</div>
                <div className="state">{this.props.state}</div>
				<div className="city">{this.props.city}</div>
                <div className="zip">{this.props.zip}</div>
				<div className="phone">{this.props.phone}</div>
                <div className="degree_urbanization">{this.props.degree_urbanization}</div>
			</div>
		);
	}
}
